import React from "react";
import {
  Box,
  Flex,
  Text,
  Button,
  Stack,
  Image,
  HStack,
} from "@chakra-ui/react";
import Bag from "../Image/Bag.png";
import User from "../Image/User.png";
import Menu from "../Image/Menu.png";
import Close from "../Image/Close.png";

function Navbar(props) {
  // eslint-disable-next-line
  const [isOpen, setIsOpen] = React.useState(false);

  const toggle = () => setIsOpen(!isOpen);

  return (
    <NavBarContainer {...props}>
      <a href="/">
        <Text as="h2" fontWeight="500" fontSize="3xl">
          Logo
        </Text>
      </a>
      <HStack>
        {/* <IconComponent /> */}
        {/* <MenuToggle isOpen={isOpen} toggle={toggle} /> */}
        <MenuLinks />
      </HStack>
    </NavBarContainer>
  );
}

const MenuToggle = ({ toggle, isOpen }) => {
  return (
    <Box display={{ base: "block", md: "none" }} onClick={toggle}>
      {isOpen ? (
        <Image src={Close} alt="Close-icon" boxSize="30px" />
      ) : (
        <Image src={Menu} alt="Menu-icon" boxSize="30px" />
      )}
    </Box>
  );
};

const IconComponent = () => {
  return (
    <>
      <HStack>
        <Image src={Bag} height="30px" width="auto" />
        <Image src={User} height="30px" width="auto" />
      </HStack>
    </>
  );
};

const MenuLinks = ({ isOpen }) => {
  return (
    <Box
      display="flex"
      justifyContent="space-between"
      //   flexBasis={{ base: "100%", md: "auto" }}
    >
      <a href="/">
        <Text display="block" fontWeight="500">
          Home
        </Text>
      </a>

      <a href="/#Products">
        <Text display="block" fontWeight="500">
          Products
        </Text>
      </a>

      <a href="/#Training">
        <Text display="block" fontWeight="500">
          {/* Training and Consultation */}
          Training
        </Text>
      </a>

      <a href="/#5s-Warm-Up">
        <Text display="block" fontWeight="500">
          5s Warm Up
        </Text>
      </a>
    </Box>
  );
};

const NavBarContainer = ({ children, ...props }) => {
  return (
    <Box
      as="nav"
      display={{ sm: "grid", md: "grid", lg: "grid", xl: "grid" }}
      gridTemplateColumns={{
        sm: "50vw ",
        md: ".5fr 1fr.5fr",
        lg: ".5fr 1fr.5fr",
        xl: ".5fr 1fr.5fr",
      }}
    //   align="center"
    //   justify="space-between"
    //   wrap="wrap"
      w="100vw"
      p="1%"
      border="1px solid red"
      {...props}
    >
      {children}
    </Box>
  );
};

export default Navbar;
